.data

# El display parte en la direccion de memoria 0x100100000 que es el primer segmento de dato que se encuetra
# en el area .data
# Por eso "display" debe ir antes que todos los demas datos
# AJUSTAR DIMENSIONES EN 256 POR 256 PIXELES
# calculo del display se necesitan 256 pixeles de largo y ancho y se necesitan 4 bits para representarlos:
#	256x4x256 = 262144 
#	288x288x4 = 331776
display: .word 0:262144

# El tablero esta representado por 3 elementos, su posicion X e Y, y la cantidad de bombas a su al rededor (pX,pY,cb)
# si la cantidad de bombas (cb) es 9 es una bomba
# 4bits de memoria x 3 elementos x 18 filas x 18 columnas = 3888
# donde un punto del tablero esta representado por cada 12 bits
# ademas se agregan 4 mas para representar el final del tablero 3888+12=3892

tablero: .word 0:3900

buffer: .byte 256
archivo: .asciiz "lectura.txt"
msg_error: .asciiz "Error :("

msg_Ingreso: .asciiz "Bienvenido!! seleccione una opcion para cargar el tablero: \n1.-Aleatorio\n2.-Texto\n3.-Salir\nIngrese su opción: "
msg_Texto: .asciiz "Recuerde tener un archivo llamado 'lectura.txt' en el directorio del programa.\nIngrese '1' y presione enter para continuar..."
msg_Coordx: .asciiz "Ingrese la posicion de la FILA: "
msg_Coordy: .asciiz "Ingrese la posicion de la COLUMNA: "
msg_Dim: .asciiz "Ingrese la DIMENSION del tablero: "
msg_Bombas: .asciiz "Ingrese la cantidad de BOMBAS: "
msg_Derrota: .asciiz "\nDeseas reintentarlo? (si = 1, no = 0): "
msg_Victoria: .asciiz "\nHas ganado!!! :D\n"
msg_Consulta_Bandera: .asciiz "¿Qué desea hacer?\n1.-Colocar Bandera\n2.-Sacar Bandera\n3.-Abrir Cuadrado\nIngrese su opcion: "
msg_Bombas_actuales: .asciiz "Lleva "
msg_Bombas_intermedio: .asciiz " bombas de "


