# MOSTRAR UNA COLUMNA DE IMAGENES

# SI NO SE CARGÓ POR ARCHIVO O ALEATORIO, SE CAERA YA QUE NO EXISTE LA VARIABLE GLOBAL S0

# $a0 direccion del array de la imagen NO SE INGRESA
# $a1 direcion de inicio del display NO SE INGRESA
