# LECTURA DE ARCHIVOS



LEER_ARCHIVOS:

li $t0,0 # CONTADOR DE COLUMNAS


# CALCULAR DIMENSIONES
la $a0, archivo
li $a1, 0 		# 0 => read, 1 => write-create, 9 => write-append-create
li $a2, 0     		# Siempre es ignorado por mars
li $v0, 13		# Syscall 13 abre de un archivo
syscall 

blt $v0,0,ERROR_LECTURA

move $a0, $v0
la $a1, buffer
li $a2, 281		# 281 ya que hay que como maximo se leeran 16x16=256 caracteres,
			# ademas de la dimension maxima se incluye el salto de linea que son 2 caracteres
			# como maximo 2*16= 32 menos los dos ultimos que no se colocan 30 mas el terminador en null 
			# 256 + 30 + 1= 281
li $v0, 14		# syscall 14 lee de un archivo
syscall

blt $v0,0,ERROR_LECTURA

la $t1,buffer


# se cierra el archivo, $a0 sigue siendo el descriptor de archivo
li $v0,16
syscall

WHILE_CONTADOR_DIMENSION_TABLERO:
lb $t2,0($t1)
beq $t2, 10, FIN_CONTADOR_DIMENSION_TABLERO	# CAMBIAR A 10 EN LINUX
addi $t1,$t1,1
addi $t0,$t0,1
j WHILE_CONTADOR_DIMENSION_TABLERO
FIN_CONTADOR_DIMENSION_TABLERO:

move $s0,$t0 # SE GUARDA LA DIMENSION EN UNA VARIABLE GLOBAL S0
addi $s0,$s0,-1 # SACAR PUEDE GENERAR ERROR EN LINUX DE DIMENSION

# FIN DEL CALCULO DE DIMENSION (revisado) guardado en t0

move $a0,$t0	# SE ASIGNA LA DIMENSION DEL TABLERO PARA GENERAR EL TABLERO
addi $sp,$sp,-4
sw $ra,0($sp)
jal CARGAR_TABLERO	# SE CREA MASCARA DEL TABLERO
lw $ra,0($sp)
sw $a0,0($sp) # SE GUARDA LA DIMENSION EN EL STACK

la $t1,buffer

li $t8,1
li $t9,0
WHILE_LEER_ARCHIVOS:
	addi $t9,$t9,1		# AUMENTA EN UNO LA COLUMNA (y)
	lb $t0,0($t1)		# SE CARGA EL BUFFER
	bgt $t8,$s0,FIN_LEER_ARCHIVOS # SE DETIENE CUANDO LA FILA ES MAYOR A LA DIMENSION
	addi $t1,$t1,1		# PASE A LA SIGUEIENTE POSICION
	beq $t0,88,AGREGAR_BOMBA_LEER_ARCHIVO 	# SI EL BUFFER ES X O x AGREGA BOMBA SI NO AUMENTA LA COLUMNA 
	beq $t0,120,AGREGAR_BOMBA_LEER_ARCHIVO	# A LA SIGUIENTE ENTRADA AL WHILE
	beq $t0,10,SALTO_LINEA 	# CAMBIAR A 10 EN LINUX
	j AGREGAR_BOMBA_LEER_ARCHIVO_AUX
		SALTO_LINEA:
		addi $t8,$t8,1		# SE AUMENTA EN UNO LA FILA
		li $t9,0		# SE REINICIA CONTADOR DE COLUMNAS	
		j AGREGAR_BOMBA_LEER_ARCHIVO_AUX
			AGREGAR_BOMBA_LEER_ARCHIVO:	
			move $a0,$t8	# SE CARGA LA POSICION X
			move $a1,$t9	# SE CARGA LA POSICION Y
			li $a2,9	# SE ASIGNA EL CONTADOR BOMBA EN NUEVE QUE REPRESENTA LA BOMBA
			lw $a3,0($sp)	# SE ASIGNA LA DIMENSION DEL TABLERO en a3
			addi $sp,$sp,-8
			sw $ra,0($sp)
			sw $t1,4($sp)
			jal CAMBIAR_POSICION_BOMBA	# SE LLAMA A LA FUNCION QUE AGREGA BOMBA
			lw $ra,0($sp)
			lw $t1,4($sp)
			beq $v0,1,SUMAR_BOMBA_AGREGADA
			j SUMAR_BOMBA_AGREGADA_AUX
				SUMAR_BOMBA_AGREGADA:
				addi $s1,$s1,1	# SE AUMENTA EN UNO LA CANTIDAD DE BOMBAS							
			SUMAR_BOMBA_AGREGADA_AUX:
			addi $sp,$sp,8
	AGREGAR_BOMBA_LEER_ARCHIVO_AUX:
	j WHILE_LEER_ARCHIVOS
FIN_LEER_ARCHIVOS:
sb $zero,0($t1) # SE GUARDA LA FILA DIMENSION,0 COMO FINAL, ES DECIR IGUAL A 0
addi $sp,$sp,4
ERROR_LECTURA:
jr $ra

