# $a0 direccion del array que contiene la imagen que se colocará
# $a1 direcion de inicio del display NO SE INGRESA A LA FUNCION
# $a2 POSICION X 
# $a3 POSICION Y


CAMBIAR_IMAGEN_POSICION:
	la $a1,display		# SE CARGA EL DISPLAY
	mul $t1,$a2,32768	# SE CALCULA MOVIMIENTO EN X
	addi $t1,$t1,32832	# 32832 = 32768+64 asi escribira desplazado una fila y una columna
	add $a1,$a1,$t1		# SE APLICA MOVIMINETO EN X
	mul $t2,$a3,64		# SE CALCULA EL MOVIMIENTO EN Y
	add $a1,$a1,$t2 	# SE OBTIENE INICIO DEL ARRAY
	addi $sp,$sp,-4		# RESERVA DE STACK PARA RA
	sw $ra,0($sp)		# SE GUARDA RA
	jal MOSTRAR_UNO		# SE MUESTRA LA IMAGEN PUESTA EN A0
	lw $ra,0($sp)		# SE CARGA RA
