# A0 POSICION X
# A1 POSICION Y
# RETORNO EN V0 0 SI NO ES BOMBA 1 SI ES BOMBA

# ========================================================================================= #

# RELLENA Y ACTUALIZA EN LA MASCARA LA CANTIDAD DE BOMBAS AL REDEDOR
# PARA HACER ESTO SE BUSCAN LAS BOMBAS Y UNA VEZ QUE SE ENCUENTRAN SE
# REALIZA UNA LLAMADA RECURSIVA SUMANDO 1 A LOS DE AL REDEDOR
# SI N,M ES BOMBA AL REDEDOR ES:
#	N,M-1
#	N,M+1
#	N-1,M
#	N+1,M
#	N+1,M-1
#	N+1,M+1
#	N-1,M-1
#	N-1,M+1


RELLENAR_TABLERO:
la $t0,tablero# SE CARGA EL TABLERO
addi $sp,$sp,-8
sw $ra,0($sp)
sw $t0,4($sp)


WHILE_RELLENA:
lw $t1,8($t0)
beq $t1,10,FIN_RELLENAR_TABLERO # SI LA  
lw $t1,8($t0)
beq $t1,9,SUMAR_AL_BORDE # SI ES BOMBA SUMAR AL REDEDOR

j SUMAR_BORDE_AUX
SUMAR_AL_BORDE:
	
	#	N,M-1
	lw $t0,4($sp)
	lw $a0,0($t0) # POSICION X (N)
	lw $t2,4($t0) # POSICION Y
	addi $a1,$t2,-1 # M-1
	jal SUMAR_POSICION_BOMBA

	#	N,M+1
	lw $t0,4($sp)
	lw $a0,0($t0) # POSICION X
	lw $t2,4($t0) # POSICION Y
	addi $a1,$t2,1
	jal SUMAR_POSICION_BOMBA
	
	#	N-1,M
	lw $t0,4($sp)
	lw $t1,0($t0) # POSICION X
	lw $a1,4($t0) # POSICION Y
	addi $a0,$t1,-1
	jal SUMAR_POSICION_BOMBA
	
	#	N+1,M
	lw $t0,4($sp)
	lw $t1,0($t0) # POSICION X
	lw $a1,4($t0) # POSICION Y
	addi $a0,$t1,1
	jal SUMAR_POSICION_BOMBA

	#	N+1,M-1	
	lw $t0,4($sp)
	lw $t1,0($t0) # POSICION X
	lw $t2,4($t0) # POSICION Y
	addi $a0,$t1,1
	addi $a1,$t2,-1
	jal SUMAR_POSICION_BOMBA
	
	#	N+1,M+1
	lw $t0,4($sp)
	lw $t1,0($t0) # POSICION X
	lw $t2,4($t0) # POSICION Y
	addi $a0,$t1,1
	addi $a1,$t2,1
	jal SUMAR_POSICION_BOMBA
	
	#	N-1,M-1
	lw $t0,4($sp)
	lw $t1,0($t0) # POSICION X
	lw $t2,4($t0) # POSICION Y
	addi $a0,$t1,-1
	addi $a1,$t2,-1
	jal SUMAR_POSICION_BOMBA
	
	#	N-1,M+1
	lw $t0,4($sp)
	lw $t1,0($t0) # POSICION X
	lw $t2,4($t0) # POSICION Y
	addi $a0,$t1,-1
	addi $a1,$t2,1
	jal SUMAR_POSICION_BOMBA
SUMAR_BORDE_AUX:
lw $t0,4($sp)
addi $t0,$t0,12
sw $t0,4($sp)
j WHILE_RELLENA
FIN_RELLENAR_TABLERO:
lw $ra,0($sp)
addi $sp,$sp,8
jr $ra
#=======================================================================================#

# SE SUMA 1 EN LAS POSICIONES DADAS POR EL NUMERO DADO
# SE CARGA EL TABLERO SE ENCUENTRA LA POSICION Y SE CAMBIA SU VALOR
# RETORNA EN V0 0 SI NO SE SUMA BOMBA, 1 SI FUE SUMADA LA BOMBA

# $A0 POSICION X
# $A1 POSICION Y
# $A3 DIMENSION ### NO SE INGRESA ###
# $v0 RETORNO 0 Ó 1


SUMAR_POSICION_BOMBA:
	
	move $a3,$s0
	
	la $t3,tablero	# SE CARGA EL TABLERO
	add $t0,$a3,2
	mul $t0,$t0,12	# SE MULTIPLICA LA (DIMENSION + 2) POR 12, 3 DATOS Y 4 BIT DE MEMORIA
	mul $t0,$a0,$t0	# SE CALCULAN EL MOVIMIENTO EN EL EJE X
	add $t3,$t3,$t0	# SE APLICA EL MOVIMIENTO
	mul $t1,$a1,12	# SE CALCULAN EL MOVIMIENTO EN EL EJE Y
	add $t3,$t3,$t1	# SE APLICA EL MOVIMIENTO
	lw $t0,8($t3)
	bne $t0,9,SUMAR_BOMBA
	j SUMAR_BOMBA_AUX
		SUMAR_BOMBA:
			lw $t0,8($t3)	# SE CARGA LA CANTIDAD DE BOMBA EN EL ESPACIO DE CANTIDAD DE BOMBA EN EL TABLERO
			addi $t0,$t0,1	# SE LE SUMA 1 A LA CANTIDAD
			sw $t0,8($t3)	# SE GUARDA LA CANTIDAD DE BOMBAS
			li $v0,1	# SE RETORNA 1
			j FIN_SUMAR_POSICION_BOMBA
	SUMAR_BOMBA_AUX:
	li $v0,0	# SE RETORNA 0
FIN_SUMAR_POSICION_BOMBA:
jr $ra

# =================================================================================== #

# A0 POSICION X
# A1 POSICION Y
# A3 dimension #NO SE INGRESA
# V0 retorna 0 si no ha perdido, 1 si perdio

ABRIR_TABLERO_POSICION:
	addi $sp,$sp,-12
	sw $ra,8($sp)
	
	bgt $a0,$s0,FIN_ABRIR_TABLERO_POSICION
	bgt $a1,$s0,FIN_ABRIR_TABLERO_POSICION
	blt $a0,1,FIN_ABRIR_TABLERO_POSICION
	blt $a1,1,FIN_ABRIR_TABLERO_POSICION
	
	la $t3,tablero
	move $a3,$s0
	add $t0,$a3,2
	mul $t0,$t0,12	# SE MULTIPLICA LA (DIMENSION + 2) POR 12, 3 DATOS Y 4 BIT DE MEMORIA
	mul $t0,$a0,$t0	# SE CALCULAN EL MOVIMIENTO EN EL EJE X
	add $t3,$t3,$t0	# SE APLICA EL MOVIMIENTO
	mul $t1,$a1,12	# SE CALCULAN EL MOVIMIENTO EN EL EJE Y
	add $t3,$t3,$t1	# SE APLICA EL MOVIMIENTO
		
	lw $t0,8($t3)
	
	sw $a0,0($sp)	# SE GUARDA LA POSICION EN X
	sw $a1,4($sp)	# SE GUARDA LA POSICION EN Y
	
	beq $t0,1,UNO
	beq $t0,2,DOS
	beq $t0,3,TRES
	beq $t0,4,CUATRO
	beq $t0,5,CINCO
	beq $t0,6,SEIS
	beq $t0,7,SIETE
	beq $t0,8,OCHO
	beq $t0,0,ABRIR_BORDES
	beq $t0,9,PERDIDA
	j FIN_ABRIR_TABLERO_POSICION 
	ABRIR_BORDES:
	la $a0,botonActivado
	li $t0,-1
	sw $t0,8($t3)
	lw $a2,0($sp)
	addi $a2,$a2,-1
	lw $a3,4($sp)
	addi $a3,$a3,-1
	jal CAMBIAR_IMAGEN_POSICION
	
		#	N,M-1
		lw $a0,0($sp) # POSICION X (N)
		lw $t2,4($sp) # POSICION Y
		addi $a1,$t2,-1 # M-1
		jal ABRIR_TABLERO_POSICION
	
		#	N,M+1
		lw $a0,0($sp) # POSICION X
		lw $t2,4($sp) # POSICION Y
		addi $a1,$t2,1
		jal ABRIR_TABLERO_POSICION
	
		#	N-1,M
		lw $t1,0($sp) # POSICION X
		lw $a1,4($sp) # POSICION Y
		addi $a0,$t1,-1
		jal ABRIR_TABLERO_POSICION
	
		#	N+1,M
		lw $t1,0($sp) # POSICION X
		lw $a1,4($sp) # POSICION Y
		addi $a0,$t1,1
		jal ABRIR_TABLERO_POSICION

		#	N+1,M-1	
		lw $t1,0($sp) # POSICION X
		lw $t2,4($sp) # POSICION Y
		addi $a0,$t1,1
		addi $a1,$t2,-1
		jal ABRIR_TABLERO_POSICION
	
		#	N+1,M+1
		lw $t1,0($sp) # POSICION X
		lw $t2,4($sp) # POSICION Y
		addi $a0,$t1,1
		addi $a1,$t2,1
		jal ABRIR_TABLERO_POSICION
	
		#	N-1,M-1
		lw $t1,0($sp) # POSICION X
		lw $t2,4($sp) # POSICION Y
		addi $a0,$t1,-1
		addi $a1,$t2,-1
		jal ABRIR_TABLERO_POSICION
	
		#	N-1,M+1
		lw $t1,0($sp) # POSICION X
		lw $t2,4($sp) # POSICION Y
		addi $a0,$t1,-1
		addi $a1,$t2,1
		jal ABRIR_TABLERO_POSICION
	
	j FIN_ABRIR_TABLERO_POSICION
	PERDIDA:
	la $a0,bomba
	lw $a2,0($sp)
	addi $a2,$a2,-1
	lw $a3,4($sp)
	addi $a3,$a3,-1
	jal CAMBIAR_IMAGEN_POSICION
	li $v0,1
	j FIN_ABRIR_TABLERO_POSICION
	
	UNO:
	la $a0,numeroUno
	j NUMEROS
	
	DOS:
	la $a0,numeroDos
	j NUMEROS
	
	TRES:
	la $a0,numeroTres
	j NUMEROS
	
	CUATRO:
	la $a0,numeroCuatro
	j NUMEROS
	
	CINCO:
	la $a0,numeroCinco
	j NUMEROS
	
	SEIS:
	la $a0,numeroSeis
	j NUMEROS
	
	SIETE:
	la $a0,numeroSiete
	j NUMEROS
	
	OCHO:
	la $a0,numeroOcho
	
	NUMEROS:
	li $v0,0
	lw $a2,0($sp)
	addi $a2,$a2,-1
	lw $a3,4($sp)
	addi $a3,$a3,-1
	jal CAMBIAR_IMAGEN_POSICION
FIN_ABRIR_TABLERO_POSICION:
lw $ra,8($sp)
addi $sp,$sp,12
jr $ra

# =================================================================================== #
#
#	SE COLOCA UNA BANDERA EN LA POSICION AUMENTANDO EN 1 EL STACK ACTUAL
# A0 POSICION X
# A1 POSICION Y
# A2 1 coloca bandera, 2 saca bandera
# A3 dimension #NO SE INGRESA
# SE AGREGA EN EL ESPACIO 0 DEL STACK 0($sp)
# LA CANTIDAD DE BOMBAS MAS 1. EN OTRAS PALABRAS:
#	lw $t0,0($sp)
#	addi $t0,$t0,1
#	sw $t0,0($sp)
####################################################################################################
### IMPORTANTE ### SE REQUIERE QUE SE ALMACENE STACK ANTES DE LLAMAR A LA FUNCION ### IMPORTANTE ###
####################################################################################################

COLOCAR_BANDERA_POSICION:
	addi $sp,$sp,-12 # SE RESERVA STACK PARA POSICION X, POSICION Y Y $RA
	sw $ra,8($sp)
	
	bgt $a0,$s0,FIN_COLOCAR_BANDERA_POSICION
	bgt $a1,$s0,FIN_COLOCAR_BANDERA_POSICION
	blt $a0,1,FIN_COLOCAR_BANDERA_POSICION
	blt $a1,1,FIN_COLOCAR_BANDERA_POSICION
	
	la $t3,tablero
	move $a3,$s0
	add $t0,$a3,2
	mul $t0,$t0,12	# SE MULTIPLICA LA (DIMENSION + 2) POR 12, 3 DATOS Y 4 BIT DE MEMORIA
	mul $t0,$a0,$t0	# SE CALCULAN EL MOVIMIENTO EN EL EJE X
	add $t3,$t3,$t0	# SE APLICA EL MOVIMIENTO
	mul $t1,$a1,12	# SE CALCULAN EL MOVIMIENTO EN EL EJE Y
	add $t3,$t3,$t1	# SE APLICA EL MOVIMIENTO
		
	lw $t0,8($t3)
	
	sw $a0,0($sp)	# SE GUARDA LA POSICION EN X
	sw $a1,4($sp)	# SE GUARDA LA POSICION EN Y
	beq $a2,2,BANDERA_POSICION_SACAR
	la $a0,bandera
	beq $t0,9,ACIERTO
	j ACIERTO_AUX
		ACIERTO:
			lw $t0,12($sp)	# SE OBTIENE CANTIDAD ACERTADA DE BOMBAS
			addi $t0,$t0,1	# SE SUMA UNO
			sw $t0,12($sp)	# SE GUARDA LA NUEVA CANTIDAD ACERTADA
	ACIERTO_AUX:
	j BANDERA_POSICION_SACAR_AUX
		RESTAR_ACIERTO:
			lw $t0,12($sp)	# SE OBTIENE CANTIDAD ACERTADA DE BOMBAS
			addi $t0,$t0,-1	# SE RESTA UNO
			sw $t0,12($sp)	# SE GUARDA LA NUEVA CANTIDAD ACERTADA
			j BANDERA_POSICION_SACAR_AUX
		BANDERA_POSICION_SACAR:
			la $a0,botonDesactivado
			beq $t0,9,RESTAR_ACIERTO
	BANDERA_POSICION_SACAR_AUX:
	lw $a2,0($sp)
	addi $a2,$a2,-1	# SE RESTA UNO PARA QUE SE DIBUJE CORRECTAMENTE A LA POSICION X
	lw $a3,4($sp)
	addi $a3,$a3,-1	# SE RESTA UNO PARA QUE SE DIBUJE CORRECTAMENTE A LA POSICION Y
	jal CAMBIAR_IMAGEN_POSICION
FIN_COLOCAR_BANDERA_POSICION:
lw $ra,8($sp)
addi $sp,$sp,12
jr $ra

FIN_FUNCIONES:
